package ctrldtmt;

public class Elseif {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int a=0,b=9,c=61;
		if(a>b && a>c)
		{
			System.out.println("a is grater");

		}else if(b>a&&b>c)
		{
			System.out.println("b is grater");

		}
		else {
			System.out.println("c is grater");

		}
	}

}
